import React from 'react';

const Footer = () => {
    return (
        <footer style={styles.footer}>
            <div style={styles.container}>
                <div style={styles.info}>
                    <p>© 2025 Компания Пример. Все права защищены.</p>
                </div>
                <div style={styles.links}>
                    <a href="/about-us" style={styles.link}>О нас</a>
                    <a href="/contact" style={styles.link}>Контакты</a>
                </div>
            </div>
        </footer>
    );
};

const styles = {
    footer: {
        backgroundColor: '#333',
        color: 'white',
        padding: '20px 0',
        position: 'relative',
        bottom: 0,
        width: '100%',
    },
    container: {
        maxWidth: '1200px',
        margin: '0 auto',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
    },
    info: {
        fontSize: '14px',
    },
    links: {
        display: 'flex',
        gap: '15px',
    },
    link: {
        color: 'white',
        textDecoration: 'none',
        fontSize: '14px',
    },
};

export default Footer;
